import React from 'react';
import {Grid} from "@mui/material";
import useStyles from "./jobs.style";

function Jobs(data) {
    const styles = useStyles();
    const is_project = data.type === 'project';
    const GradiantBorder = is_project ? styles.ProjectsGradiantBorder : styles.JobsGradiantBorder;

    return (
        <div style={{color: 'white'}}>
            <Grid className={styles.JobsContainer + '  ' + GradiantBorder} container spacing={2}>
                <div className="col-9">
                    <h2 className={styles.JobTitle}>
                        {data.JobTitle}
                    </h2>
                    <p style={{fontWeight : "600"}}>
                        {data.JobDepartment}
                    </p>
                    <p >
                        {data.JobDescription}
                    </p>
                </div>
                <div className="col-3">
                    <h4>
                        {data.JobDuration}
                    </h4>
                </div>
            </Grid>
        </div>
    );
}

export default Jobs;
